import { CHARACTER_LIST, SEARCH_CHARACTER } from './type'

export const chracterList = () => {
  return {
    type: CHARACTER_LIST
  }
}

export const characterSearch = (data) => {
  return {
    type: SEARCH_CHARACTER,
    data
  }
}
